;;Validation methods
(defn valid-labyrinth-one-way
  "Checks whether the labyrinth is valid and contains at least one unidirectional connection between 2 rooms"
  ([labyrinth]
   (cond
     (or (nil? labyrinth) (not (map? labyrinth)) (empty? labyrinth)) ;Checks if the labyrinth is a map and is not empty
       (println "Invalid format. The valid format for labyrinths is a non-empty map")
     (some #(some (fn [x] (= x (first %))) (second %)) labyrinth) ;For each set in the graph it checks whether any element in the
       (println "Rooms cannot be connected to themselves.")       ;list is the same as the key
     (some #(or (nil? (first %)) (some (fn [x] (nil? x)) (second %))) labyrinth) ;Goes through all the values in the graph
       (println "Nil is not a valid room")                                       ;and checks for nil
     (some #(some (fn [x] (not (contains? labyrinth x))) (second %)) labyrinth) ;For each list list in the graph it checks whether
       (println "One of the rooms is connected to an nonexistent room!")        ;any element is not a key in the map
     :else
       (valid-labyrinth-one-way labyrinth labyrinth)))      ;Call to recursive function to check for connected rooms
  ([rest-labyrinth full-labyrinth]
   (if (empty? rest-labyrinth)                              ;End case, finished traversing the graph and no connected rooms found
     (println "Invalid format. The labyrinth needs at least 2 rooms with a one-way connection to be valid.")
     (if (loop [current-key (first (first rest-labyrinth))  ;Traversing the graph set-by-set
                current-connections (second (first rest-labyrinth))] ;Traversing the list of the current key
           (if (empty? current-connections)                 ;If room is not connected to anything we skip the set
             false
             (if (and (contains? full-labyrinth (first current-connections)) ;If any of the lists contain a key in the graph
                      (not= (first current-connections) current-key))        ;that is not the same as the current key, then
               true                                                          ;labyrinth is valid
               (recur current-key (rest current-connections)))))             ;Otherwise we go to the next element in the list
       true                                                 ;If condition is satisfied for a set then labyrinth is valid
       (recur (rest rest-labyrinth) full-labyrinth)))))     ;Otherwise we go to the next set

(defn valid-labyrinth-interconnected
  "Checks whether the labyrinth is valid and contains at least one bidirectional connection between 2 rooms"
  ([labyrinth]
   (cond
     (or (nil? labyrinth) (not (map? labyrinth)) (empty? labyrinth)) ;Checks if the labyrinth is a map and is not empty
       (println "Invalid format. The valid format for labyrinths is a non-empty map")
     (some #(some (fn [x] (= x (first %))) (second %)) labyrinth) ;For each set in the graph it checks whether any element in the
       (println "Rooms cannot be connected to themselves.")       ;list is the same as the key
     (some #(or (nil? (first %)) (some (fn [x] (nil? x)) (second %))) labyrinth) ;Goes through all the values in the graph
       (println "Nil is not a valid room")                                       ;and checks for nil
     (some #(some (fn [x] (not (contains? labyrinth x))) (second %)) labyrinth) ;For each list list in the graph it checks whether
       (println "One of the rooms is connected to an nonexistent room!")        ;any element is not a key in the map
     :else
       (valid-labyrinth-interconnected labyrinth labyrinth))) ;Call to recursive function to check for connected rooms
  ([rest-labyrinth full-labyrinth]
   (if (empty? rest-labyrinth)                              ;End case, finished traversing the graph and no connected rooms found
     (println "Invalid format. The labyrinth needs at least 2 interconnected rooms to be valid.")
     (if (loop [current-key (first (first rest-labyrinth))  ;Traversing the graph set-by-set
                current-connections (second (first rest-labyrinth))] ;Traversing the list of the current key
           (if (empty? current-connections)                 ;If room is not connected to anything we skip the set
             false
             (if (and (contains? full-labyrinth (first current-connections)) ;If any of the lists contain a key in the graph
                      (not= (first current-connections) current-key)         ;that is not the same as the current key, then
                      (some #(= current-key %) (full-labyrinth (first current-connections)))) ;if the list of that key contains the current key
               true                                         ;Labyrinth is valid
               (recur current-key (rest current-connections))))) ;Otherwise we go to the next element in the list
       true                                                 ;If condition is satisfied for a set then labyrinth is valid
       (recur (rest rest-labyrinth) full-labyrinth)))))     ;Otherwise we go to the next set

(defn positions-check-one-way [labyrinth minotaur-position theseus-position]
  "Checks whether Minotaur and Theseus are placed in connected rooms (uni/bi directional)"
  (if (and (not= minotaur-position theseus-position)                         ;Checks whether they are placed in different rooms
           (or (some #(= minotaur-position %) (labyrinth theseus-position))  ;and at least one room contain the key of the other
               (some #(= theseus-position %) (labyrinth minotaur-position))));in its list
    true
    (println "The Minotaur and Theseus need to be placed in 2 rooms with at least a one-way connection!")))

(defn positions-check-interconnected [labyrinth minotaur-position theseus-position]
  "Checks whether Minotaur and Theseus are placed in connected rooms  (bidirectional)"
  (if (and (not= minotaur-position theseus-position)                         ;Checks whether they are placed in different rooms
           (some #(= minotaur-position %) (labyrinth theseus-position))      ;and both rooms contain the key of the other in their
           (some #(= theseus-position %) (labyrinth minotaur-position)))     ;lists
    true
    (println "The Minotaur and Theseus need to be placed in two interconnected rooms!")))

(defn cavern-escape-check [possible-passages candle-locations theseus-position]
  "Checks whether Minotaur can move to any room and returns the first one found or nil if he cannot"
  (let [cavern (first possible-passages)]                   ;Loop through the possible passages
    (if (and (not (some (partial = cavern) candle-locations)) ;Check if the current element is in candle locations
             (not (= cavern theseus-position)))             ;Check if current element is same as theseus' position
      cavern                                                ;Return the valid room where Minotaur can move
      (cavern-escape-check (rest possible-passages) candle-locations theseus-position)))) ;Go to the next element

;;Solution 1. Head recursive escape check
(defn minotaur-trap
  "Finds the candle locations and where Minotaur dies using head-recursion"
  ([labyrinth minotaur-position theseus-position candle-period]
   (if (and (valid-labyrinth-interconnected labyrinth)      ;Using helper method to check for valid arguments
            (positions-check-interconnected labyrinth minotaur-position theseus-position)
            ((fn [candle-period] (if (and (integer? candle-period) (>= candle-period 1)) ;Check that candle period is an integer
                                  true
                                  (println "The candle period needs to be an integer and at least 1!")))
             candle-period))
     (minotaur-trap labyrinth minotaur-position theseus-position candle-period '() 0) ;Call to main recursive function
     nil))
  ([labyrinth minotaur-position theseus-position candle-period placed-candles candle-counter]
    (let [cavern (cavern-escape-check (labyrinth minotaur-position) placed-candles theseus-position)]
      (if (nil? cavern)                                     ;Cavern represents the room that Minotaur is going to next (using helper function)
        (list (symbol (str '/ minotaur-position)))          ;If not found we return the room where Minotaur is trapped
        (if (= candle-counter candle-period)
          (cons theseus-position                            ;Add the location of the candle to the call for the next step
                (minotaur-trap labyrinth
                               cavern
                               minotaur-position
                               candle-period
                               (cons theseus-position placed-candles)
                               1))
          (minotaur-trap labyrinth                          ;Call for the next step and increasing the candle-counter
                         cavern
                         minotaur-position
                         candle-period
                         placed-candles
                         (inc candle-counter)))))))

;;Solution 2. Tail recursive escape check
(defn theseus-and-minotaur
  "Finds the candle locations and where Minotaur dies using tail-recursion"
  ([labyrinth-map, minotaur-location, theseus-location, candle-period]
   (if (and (valid-labyrinth-interconnected labyrinth-map)  ;Using helper method to check for valid arguments
            (positions-check-interconnected labyrinth-map, minotaur-location, theseus-location)
            (and (integer? candle-period) (>= candle-period 1))) ;Check that candle period is an integer
     (theseus-and-minotaur labyrinth-map, minotaur-location, theseus-location, candle-period, '(), 0)
     nil))                                                  ;Call to main recursive function
  ([labyrinth-map, minotaur-location, theseus-location, candle-period, candle-locations, candle-counter]
   (loop [labyrinth-map labyrinth-map minotaur-location minotaur-location
          theseus-location theseus-location candle-period candle-period
          candle-locations candle-locations candle-counter candle-counter] ;loop for better use of recur
     (if (cavern-escape-check (get labyrinth-map minotaur-location), candle-locations, theseus-location) ;checking next possible room
       (if (= candle-period candle-counter)
         (recur labyrinth-map                               ;Add the location of the candle to the call for the next step
                (cavern-escape-check (get labyrinth-map minotaur-location)
                                     candle-locations
                                     theseus-location)
                minotaur-location
                candle-period
                (cons theseus-location candle-locations )
                1)
         (recur labyrinth-map                               ;Call for the next step and increasing the candle-counter
                (cavern-escape-check (get labyrinth-map minotaur-location)
                                     candle-locations
                                     theseus-location)
                minotaur-location
                candle-period
                candle-locations
                (inc candle-counter)))
       (reverse (cons (symbol (str "/" minotaur-location)) candle-locations)))))) ;If not found we return the room where Minotaur is trapped

;;Solution 3. Iterative escape check
(defn cavern-escape-check-iterative [possible-passages candle-locations theseus-position]
  "Checks (without recursion) whether Minotaur can move to any room and returns the first one found or nil if he cannot"
  (let [stoppers (conj candle-locations theseus-position)]  ;Conjoining candles and Theseus' position as stoppers
    (first (filter (fn [x] (not (some #(= x %) stoppers))) possible-passages)))) ;Check if any element in stoppers is also in possible-passages

(defn valid-labyrinth-one-way-iterative [labyrinth]
  "Checks (iteratively) whether the labyrinth is valid and contains at least one unidirectional connection between 2 rooms"
  (cond
    (or (nil? labyrinth) (not (map? labyrinth)) (empty? labyrinth)) ;Checks if the labyrinth is a map and is not empty
    (println "Invalid format. The valid format for labyrinths is a non-empty map")
    (some #(some (fn [x] (= x (first %))) (second %)) labyrinth) ;For each set in the graph it checks whether any element in the
    (println "Rooms cannot be connected to themselves.")         ;list is the same as the key
    (some #(or (nil? (first %)) (some (fn [x] (nil? x)) (second %))) labyrinth) ;Goes through all the values in the graph
    (println "Nil is not a valid room")                                         ;and checks for nil
    (some #(some (fn [x] (not (contains? labyrinth x))) (second %)) labyrinth) ;For each list in the graph it checks whether
    (println "One of the rooms is connected to an nonexistent room!")          ;any element is not a key in the map
    (not (some #(some (fn [x] (contains? labyrinth x)) (second %)) labyrinth)) ;Checking if any lists contain a key from the graph
    (println "Invalid format. The labyrinth needs at least 2 rooms with a one-way connection to be valid.")
    :else
    true))

(defn connection [labyrinth check-node current-node]
  "Checks if 'check-node' has a connection to 'current-node'"
  (some (fn [x] (= x current-node)) (labyrinth check-node)))

(defn valid-labyrinth-interconnected-iterative [labyrinth]
  (cond
    (or (nil? labyrinth) (not (map? labyrinth)) (empty? labyrinth)) ;Checks if the labyrinth is a map and is not empty
    (println "Invalid format. The valid format for labyrinths is a non-empty map")
    (some #(some (fn [x] (= x (first %))) (second %)) labyrinth) ;For each set in the graph it checks whether any element in the
    (println "Rooms cannot be connected to themselves.")         ;list is the same as the key
    (some #(or (nil? (first %)) (some (fn [x] (nil? x)) (second %))) labyrinth) ;Goes through all the values in the graph
    (println "Nil is not a valid room")                                         ;and checks for nil
    (some #(some (fn [x] (not (contains? labyrinth x))) (second %)) labyrinth) ;For each list list in the graph it checks whether
    (println "One of the rooms is connected to an nonexistent room!")          ;any element is not a key in the map
    (not (some #(some (fn [x] (and (connection labyrinth (first %) x)   ;Checking if any lists contain a key from the graph
                                   (connection labyrinth x (first %)))) ;and that said key also has a list that contains the
                      (second %)) labyrinth))                           ;current key
    (println "Invalid format. The labyrinth needs at least 2 rooms with a one-way connection to be valid.")
    :else
    true))

(defn minotaur-trap-iterative
  "Finds the candle locations and where Minotaur dies using head-recursion and iterative helper functions"
  ([labyrinth minotaur-position theseus-position candle-period]
