             candle-period))
     (minotaur-trap-iterative labyrinth minotaur-position theseus-position candle-period '() 0) ;Call to main recursive function
     nil))
  ([labyrinth minotaur-position theseus-position candle-period placed-candles candle-counter]
   (let [cavern (cavern-escape-check-iterative (labyrinth minotaur-position) placed-candles theseus-position)]
     (if (nil? cavern)                                      ;Cavern represents the room that Minotaur is going to next (using helper function)
       (list (symbol (str '/ minotaur-position)))           ;If not found we return the room where Minotaur is trapped
       (if (= candle-counter candle-period)
         (cons theseus-position                             ;Add the location of the candle to the call for the next step
               (minotaur-trap-iterative labyrinth
                              cavern
                              minotaur-position
                              candle-period
                              (cons theseus-position placed-candles)
                              1))
         (minotaur-trap-iterative labyrinth                 ;Call for the next step and increasing the candle-counter
                        cavern
                        minotaur-position
                        candle-period
                        placed-candles
                        (inc candle-counter)))))))

