;;Solution 5. Makes use of the while function and atomic variables

(defn minotaur-trap-atomic
  "Finds the candle locations and where Minotaur dies using a while and atomic variables"
  ([labyrinth minotaur-position theseus-position candle-period]
   (if (and (valid-labyrinth-interconnected-iterative labyrinth)      ;Using helper method to check for valid arguments
            (positions-check-interconnected labyrinth minotaur-position theseus-position)
            ((fn [candle-period] (if (and (integer? candle-period) (>= candle-period 1)) ;Check that candle period is an integer
                                   true
                                   (println "The candle period needs to be an integer and at least 1!")))
             candle-period))
     (minotaur-trap-atomic labyrinth minotaur-position theseus-position candle-period '() 0) ;Call to main recursive function
     nil))
  ([labyrinth minotaur-position theseus-position candle-period placed-candles candle-counter]
   (let [minotaur-position (atom minotaur-position) theseus-position (atom theseus-position) ;All variables that need to change
         placed-candles (atom placed-candles) candle-counter (atom candle-counter)]          ;are turned into atoms
     (do (while (not (nil? (cavern-escape-check-iterative (labyrinth @minotaur-position) @placed-candles @theseus-position)))
           (if (= @candle-counter candle-period)            ;While Minotaur can escape we execute the code
             (do (let [old-t-position @theseus-position]    ;Temporary old Theseus position to not lose it after changing it
                   (reset! theseus-position @minotaur-position) ;Resetting TP atom to the de-ref of MP
                   (reset! minotaur-position (cavern-escape-check-iterative (labyrinth @minotaur-position)
                                                                            @placed-candles
                                                                            old-t-position)) ;Resetting MP atom to next room
                   (swap! placed-candles conj old-t-position)) ;Conjoining old-t-position to placed candles atom
                 (reset! candle-counter 1))                 ;Resetting candle-counter atom to 1
             (do (let [old-t-position @theseus-position]    ;Temporary old Theseus position to not lose it after changing it
                   (reset! theseus-position @minotaur-position) ;Resetting TP atom to the de-ref of MP
                   (reset! minotaur-position (cavern-escape-check-iterative (get labyrinth @minotaur-position)
                                                                            @placed-candles
                                                                            old-t-position))) ;Resetting MP atom to next room
                 (swap! candle-counter inc))                ;Applying increase to the candle-counter atom
             ))
         (reverse (conj @placed-candles (symbol (str '/ @minotaur-position)))))))) ;Returning the placed candles atom de-ref
                                                                                   ;after while is finished and adding the
                                                                                   ;room where Minotaur is trapped

