(defn tester [tests]                                        ;prints any test that fails, no output if all successful
  (doseq [test tests]
    (mif ['(?id -- ?pre => ?post) test]
         (when-not (= (eval (? pre)) (? post))
           (println 'Test 'Failed '- 'Id (? id) '-- 'Actual (eval(? pre))  '=> 'Expected  (? post))))))

